void print(const char *str) {
    gfx_PrintString(str);
}

void print(const char *str, int x, int y, uint8_t col) {
    gfx_SetTextFGColor(col);
    gfx_PrintStringXY(str, SCREEN_X(x), SCREEN_Y(y));
}

void print_int(int n, int x, int y, uint8_t col) {
    gfx_SetTextXY(SCREEN_X(x), SCREEN_Y(y));
    gfx_SetColor(col);
    print_int(n);
}

void print_int(int n) {
    print_int(n, 1);
}

void print_int(int n, int l) {
    gfx_PrintInt(n, l);
}

void rectfill(int x0, int y0, int x1, int y1, uint8_t col) {
    gfx_SetColor(col);
    gfx_FillRectangle(SCREEN_X(x0), SCREEN_Y(y0), x1 - x0, y1 - y0);
}

void circfill(int x, int y, int radius, int col) {
    gfx_SetColor(col);
    gfx_FillCircle(SCREEN_X(x), SCREEN_Y(y), radius);
}

void camera() {
    camera(0, 0);
}

void camera(int x, int y) {
    offset.x = x + BASE_X;
    offset.y = y + BASE_Y;
}

bool fget(uint8_t tile, uint8_t flag) {
    return tile < sizeof mask && (mask[tile] & (1 << flag)) != 0;
}

void map(int cell_x, int cell_y, int sx, int sy, int cell_w, int cell_h, uint8_t layers) {
    for(int y = 0; y < cell_h; y++) {
        for(int x = 0; x < cell_w; x++) {
            uint8_t tile = tilemap[x + cell_x + (y + cell_y) * 128];
            // I don't think this is how the PICO-8 actually handles the layers argument but whatevs
            if(tile < NUM_SPRITES && (layers == 0 || fget(tile, layers))) {
                gfx_TransparentSprite(atlas_tiles[tile], offset.x + sx + x * 8, offset.y + sy + y * 8);
            }
        }
    }
}

void spr(uint8_t n, int x, int y, uint8_t w, uint8_t h, bool flip_x, bool flip_y) {
    if(w != 1 || h != 1) dbg_printf("tried to use multi-width sprite");
    gfx_sprite_t *sprite = atlas_tiles[n];
    gfx_TempSprite(temp, 8, 8);
    if(flip_x) {
        gfx_FlipSpriteY(sprite, temp);
        gfx_TransparentSprite(temp, x + offset.x, y + offset.y);
        return;
    } else if(flip_y) {
        gfx_FlipSpriteX(sprite, temp);
        gfx_TransparentSprite(temp, x + offset.x, y + offset.y);
        return;
    }
    // todo: both?
    gfx_TransparentSprite(sprite, x + offset.x, y + offset.y);
}

